import React from 'react';
import './UserItem.css';

const UsersItem = props => {
    return (
        <li className='user-item'>
            <div className='user-item__content'>
                <div className='user-item__image'>
                    <img src={props.image} alt={props.name}/>
                </div>
            </div>
        </li>
    );
};

export default UsersItem;
